  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0155911 includes physical
  and underway data collected aboard the MELVILLE during cruise MGLN03MV in the North
  Pacific Ocean from 2006-05-18 to 2006-05-29. These data include CURRENT SPEED -
  EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by D.
  Randolph Watts of The University of Rhode Island, and by University of California
  - San Diego; Scripps Institution of Oceanography as part of Kuroshio Extension System
  Study (KESS). The Lamont-Doherty Earth Observatory (LDEO) submitted these data to
  NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
  ADCP data represent the raw and automated processed data set. Post processed quality
  assessed data are not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
